import './App.css';
import React, { useEffect, useState } from 'react';

import Header from './component/Header'
import MainPage from './component/MainPage';
import DisplayInfo from './component/DisplayInfo';

import LoveFramesApp from './component/LoveFramesApp';
import NaturePhotosApp from './component/NaturePhotosApp';
import SmartyMenJacket from './component/SmartyMenJacket';
import PicCollageMaker from './component/PicCollageMaker';

import DisplayFrame from './component/DisplayFrame';

import 'bootstrap/dist/css/bootstrap.min.css';


function App() {
  const [pic, setPic]=useState("")
  const [trigger, setTrigger]=useState(false)
  const [infoTrigger, setInfoTrigger]=useState(false)
  const [dataTrigger, setDataTrigger]=useState(false)
  const [appInfo, setAppInfo]= useState({})
  const [triggerApp, setTriggerApp]=useState('')
  const categoryOptions = [
    {label: 'Love Photo Frames', value:'161.97.164.28:8080,com.tas.ultimate.frames.editor,TAS,Love Photo Frames'},
    {label: 'Nature Photo Editor', value:'161.97.164.28:9001,com.mm.nature.photo.editor,MM,Nature Photo Editor'},
    {label: 'Smarty Men Jacket', value:'164.68.111.220:9001,com.las.smarty.jacket.editor,LAS,Smarty Men Jacket'},
    {label: 'Pic Collage Maker', value:'164.68.111.220:9001,com.las.collage.maker,LAS,Pic Collage Maker'},
  ];

  useEffect(()=>{
  },[])

  return (
    <div className="App">
      <Header />

      <MainPage
        categoryOptions={categoryOptions}
        setInfoTrigger={setInfoTrigger}
        setDataTrigger={setDataTrigger}
        setAppInfo= {setAppInfo}
        setTriggerApp={setTriggerApp}
      />
      {
        triggerApp &&
        <DisplayInfo
          className="appInfoBox"
          infoTrigger={infoTrigger}
          appInfo={appInfo}
        />
      }
      <hr/>
      {triggerApp=== 'Love Photo Frames' && 
        <LoveFramesApp
        trigger={trigger} 
        setTrigger={setTrigger} 
        pic={pic} 
        setPic={setPic} 
        dataTrigger={dataTrigger}
        setDataTrigger={setDataTrigger}
        /> 
      }

      {triggerApp=== 'Nature Photo Editor' && 
        <NaturePhotosApp
          trigger={trigger} 
          setTrigger={setTrigger} 
          pic={pic} 
          setPic={setPic} 
          dataTrigger={dataTrigger}
          setDataTrigger={setDataTrigger}
        />
      }

      {triggerApp=== 'Smarty Men Jacket' && 
        <SmartyMenJacket
          trigger={trigger} 
          setTrigger={setTrigger} 
          pic={pic} 
          setPic={setPic} 
          dataTrigger={dataTrigger}
          setDataTrigger={setDataTrigger}
        />
      }

      {triggerApp=== 'Pic Collage Maker' && 
        <PicCollageMaker
          trigger={trigger} 
          setTrigger={setTrigger} 
          pic={pic} 
          setPic={setPic} 
          dataTrigger={dataTrigger}
          setDataTrigger={setDataTrigger}
        />
      }

      <DisplayFrame 
        trigger={trigger} 
        setTrigger={setTrigger} 
        pic={pic} 
        setPic={setPic}
      />


    </div>
  );
}

export default App;
